  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:28.858733\",\n\t\"name\": \"lee-metcalf-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lee Metcalf
  NWR outlines Refuge accomplishments during the 1984 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, funding, and safety is
  given. Habitat management is also covered; subjects include wetlands, forests, croplands,
  grasslands, grazing, and fire management. The wildlife section of the report discusses
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, and game mammals. The public uses of the Refuge described in this report
  include hunting, fishing, trapping, wildlife observation, and law enforcement. The
  equipment and facilities section of the report provides information about major
  maintenance. Items of interest are provided at the end. Refuge brochures are attached.\",\n\t\"license_title\":
